function Page() {
    const[page, setPage] = useState(1);
    return (
      <>
        <button onClick={() => setPage(1)}>1</button>

        <button onClick={() => setPage(2)}>2</button>

        {page === 1 && <Introduction/>}

        {page === 2 && <Plan/>}
      </>
    );
  }
  export default Page;
